import React from "react";
import bgimg3 from "../../image/bgimg3.png";
import { Card } from "react-bootstrap";

export default function Footer() {
  return (
    <Card className="text-white">
      <Card.Img src={bgimg3} alt="Card image" style={{ height: "500px" }} />
      <Card.ImgOverlay>
        <Card.Title>
          <h1>iPicXel</h1>
        </Card.Title>

        <Card.Text>
          <h3>
            Address: SriRam Summit Wing:3, 3rd Floor Electronic City Phase 1,
            Bengaluru, Karnatakta-560100
          </h3>
        </Card.Text>
        <Card.Text>
          All the copyright reserved to the @ wittymindstechnologies.
        </Card.Text>
      </Card.ImgOverlay>
    </Card>
  );
}
